import React, {useState} from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';
import { sizing } from '@material-ui/system';
import Button from "@material-ui/core/Button";
import Box from "@material-ui/core/Box";
import greenBackground from '../images/vitalii-pavlyshynets-kcRFW-Hje8Y-unsplash.jpg'

const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        background: 'linear-gradient(24deg, rgba(0,91,20,0) 0%, rgba(197,255,126,0) 100%);'
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: 'black',
        vh: '100%'
    },
    box: {
      backgroundImage: `url(${greenBackground})`
    },
    button: {
        textAlign: 'center',
        color: theme.palette.text.secondary,
        padding: theme.spacing(2),
    }

}));

const HomeBody = () => {
    const classes = useStyles();

    return(
        <div>
            <Box height="100%" className={classes.box}>
                <Grid container direction='row' justify='center' spacing={3} height="100%">
                    <h1>Hello World</h1>
                </Grid>
            </Box>
        </div>
    )
}
export default HomeBody
